   300→                </td>
   301→            </tr>
   302→            <tr>
   303→                <th scope="row">Type</th>
   304→                <td><a href="/wiki/Mockup">Mockup</a>, <a href="/wiki/HTML">HTML</a></td>
   305→            </tr>
   306→            <tr>
   307→                <th scope="row">Created by</th>
   308→                <td><a href="/wiki/User:PromptEngineer">User:PromptEngineer</a></td>
   309→            </tr>
   310→            <tr>
   311→                <th scope="row">Purpose</th>
   312→                <td>Visual Mimicry</td>
   313→            </tr>
   314→            <tr>
   315→                <th scope="row">Status</th>
   316→                <td>Active (Static)</td>
   317→            </tr>
   318→            <tr>
   319→                <th scope="row">Written in</th>
   320→                <td>HTML5, CSS3</td>
   321→            </tr>
   322→        </table>
   323→
   324→        <p><b>Not-Wikipedia</b> is a theoretical concept and <a href="/wiki/Digital_artifact">digital artifact</a> describing an entity that possesses the visual characteristics of <a href="/wiki/Wikipedia">Wikipedia</a> but lacks the underlying database, server infrastructure, or collaborative community. While appearing identical to the popular online encyclopedia, Not-Wikipedia functions as a "shell" or a "facade."<sup><a href="#cite1">[1]</a></sup></p>
   325→        
   326→        <p>The concept is often used in computer science education to demonstrate <a href="/wiki/Front-end_web_development">front-end web development</a>, specifically the replication of <a href="/wiki/Cascading_Style_Sheets">cascading style sheets</a> (CSS) without back-end functionality.</p>
   327→
   328→        <div id="toc">
   329→            <h2>Contents</h2>
   330→            <ul>
   331→                <li><span class="tocnumber">1</span> <a href="#History">History</a></li>
   332→                <li><span class="tocnumber">2</span> <a href="#Characteristics">Characteristics</a></li>
   333→                <li><span class="tocnumber">3</span> <a href="#See_also">See also</a></li>
   334→                <li><span class="tocnumber">4</span> <a href="#References">References</a></li>
   335→            </ul>
   336→        </div>
   337→
   338→        <h2 id="History">History<span class="mw-editsection">[<a href="/wiki/Not-Wikipedia?action=edit&section=1">edit</a>]</span></h2>
   339→        <p>The origins of Not-Wikipedia can be traced back to early web design tutorials. Designers sought to replicate the clean, information-dense layout of Wikipedia's "Vector" skin. The term itself was coined to describe the phenomenon of "uncanny valley" web design, where a user believes they are browsing a wiki, only to realize the links do not function.</p>
   340→        <p>In 2026, the concept gained popularity as a method for testing <a href="/wiki/Large_language_model">Large Language Models</a> (LLMs) and their ability to generate structured HTML code.<sup><a href="#cite2">[2]</a></sup></p>
   341→
   342→        <h2 id="Characteristics">Characteristics<span class="mw-editsection">[<a href="/wiki/Not-Wikipedia?action=edit&section=2">edit</a>]</span></h2>
   343→        <p>Not-Wikipedia pages are defined by several distinct features:</p>
   344→        <ul>
   345→            <li><b>Visual Identity:</b> Use of the font families <i>Linux Libertine</i> for headings and <i>sans-serif</i> for body text.</li>
   346→            <li><b>Static Nature:</b> Unlike a real wiki, the "Edit" tab does not allow for actual content modification.</li>
   347→            <li><b>Color Palette:</b> Strict adherence to the hex codes <code>#f6f6f6</code> (background) and <code>#a7d7f9</code> (borders).</li>
   348→        </ul>
   349→
   350→        <h2 id="See_also">See also<span class="mw-editsection">[<a href="/wiki/Not-Wikipedia?action=edit&section=3">edit</a>]</span></h2>
   351→        <ul>
   352→            <li><a href="/wiki/Lorem_ipsum">Lorem ipsum</a></li>
   353→            <li><a href="/wiki/Mockup">Mockup</a></li>
   354→            <li><a href="/wiki/Simulation_hypothesis">Simulation hypothesis</a></li>
   355→            <li><a href="chronolinguistics.html">Chronolinguistics</a></li>
   356→            <li><a href="collective-memory-maintenance.html">Collective Memory Maintenance</a></li>
   357→            <li><a href="consciousness-archaeology.html">Consciousness Archaeology</a></li>
   358→            <li><a href="echo-cartography.html">Echo Cartography</a></li>
   359→            <li><a href="ghost-vocabulary.html">Ghost Vocabulary</a></li>
   360→            <li><a href="lexical-half-life.html">Lexical Half-life</a></li>
   361→            <li><a href="mnemonic-commons.html">Mnemonic Commons</a></li>
   362→            <li><a href="psychostrata.html">Psychostrata</a></li>
   363→            <li><a href="semantic-drift.html">Semantic Drift</a></li>
   364→            <li><a href="semantic-hygiene.html">Semantic Hygiene</a></li>
   365→            <li><a href="semantic-stratigraphy.html">Semantic Stratigraphy</a></li>
   366→            <li><a href="temporal-debt.html">Temporal Debt</a></li>
   367→        </ul>
   368→
   369→        <h2 id="References">References<span class="mw-editsection">[<a href="/wiki/Not-Wikipedia?action=edit&section=4">edit</a>]</span></h2>
   370→        <ol class="reflist">
   371→            <li id="cite1"><b>^</b> Smith, J. (2024). <i>The Illusion of Information: Web Design in the AI Era</i>. Fake Press.</li>
   372→            <li id="cite2"><b>^</b> "Generating UI Components with Text Prompts". <i>Journal of Synthetic Media</i>. Retrieved 2026-01-29.</li>
   373→        </ol>
