   304→        <h1 id="firstHeading">Semantic stratigraphy</h1>
   305→        <div id="siteSub">From Wikipedia, the free encyclopedia</div>
   306→        <div id="contentSub"><i>Not to be confused with <a href="/wiki/Stratigraphy">geological stratigraphy</a> or <a href="/wiki/Stratigraphic_linguistics">stratigraphic linguistics</a>.</i></div>
   307→
   308→        <table class="ambox">
   309→            <tr>
   310→                <td><b>This article describes a methodology for analyzing structures that have not yet fully formed.</b> Interpretations of stratal deposits may vary between excavators. <small><i>(January 2026)</i></small></td>
   311→            </tr>
   312→        </table>
   313→
