   345→            </tr>
   346→        </table>
   347→
   348→        <p><b>Semantic stratigraphy</b> is a proposed methodology within <a href="chronolinguistics.html">chronolinguistics</a> and <a href="consciousness-archaeology.html">consciousness archaeology</a> for analyzing the layered deposits of meaning that accumulate in individual and collective memory systems. First outlined by Dr. Fiona MacLeod and Dr. Rashid Osman at the Edinburgh Institute for Temporal Studies in 2024, the approach adapts principles from <a href="/wiki/Stratigraphy">geological stratigraphy</a> to examine how meanings are deposited, compressed, transformed, and occasionally inverted over time.<sup><a href="#cite1">[1]</a></sup></p>
   349→
   350→        <p>Unlike <a href="echo-cartography.html">echo cartography</a>, which maps the spatial distribution of meaning across semantic terrain, semantic stratigraphy focuses on the vertical dimension—the depth and sequence of meaning deposits at any given location in the <a href="mnemonic-commons.html">mnemonic commons</a>. The methodology treats meanings not as static entities but as sedimentary accumulations whose present form reflects their entire depositional history.<sup><a href="#cite2">[2]</a></sup></p>
   351→
