   377→
   378→        <h2 id="Theoretical_foundations">Theoretical foundations<span class="mw-editsection">[<a href="/wiki/Semantic_stratigraphy?action=edit&section=1">edit</a>]</span></h2>
   379→
   380→        <h3 id="Principle_of_superposition">Principle of superposition</h3>
   381→        <p>Semantic stratigraphy adapts the geological <a href="/wiki/Law_of_superposition">principle of superposition</a> to the domain of meaning: in an undisturbed sequence of meaning deposits, the oldest meanings lie at the bottom and progressively younger meanings are deposited on top. This allows researchers to establish relative chronologies of semantic change by examining the order of layers.<sup><a href="#cite3">[3]</a></sup></p>
   382→
   383→        <p>The principle holds that when a word or concept acquires a new meaning, this meaning does not replace but rather overlays the previous one, creating a stratified column of significations. The <b>semantic column</b> of any given term thus represents its complete history of meanings, with the most recent and accessible at the surface and earlier meanings compressed beneath.<sup><a href="#cite4">[4]</a></sup></p>
   384→
   385→        <p>MacLeod and Osman identified three types of superposition relationships:</p>
   386→        <ul>
   387→            <li><b>Conformable:</b> Continuous deposition where each new meaning builds logically upon prior meanings</li>
   388→            <li><b>Disconformable:</b> Periods of non-deposition where a term remains semantically stable, followed by renewed accumulation</li>
   389→            <li><b>Unconformable:</b> Interruptions where some meanings have been eroded before new deposition, creating gaps in the semantic record<sup><a href="#cite5">[5]</a></sup></li>
   390→        </ul>
   391→
   392→        <h3 id="Meaning_horizons">Meaning horizons</h3>
   393→        <p><b>Meaning horizons</b> are distinct, identifiable layers within the semantic column that represent specific periods or events of meaning deposition. Named by analogy to geological <a href="/wiki/Soil_horizon">soil horizons</a>, these layers can be identified by their characteristic properties:<sup><a href="#cite6">[6]</a></sup></p>
   394→
   395→        <ul>
   396→            <li><b>Composition:</b> The types of associative elements, connotations, and usage contexts embedded in the layer</li>
   397→            <li><b>Texture:</b> The density and granularity of meaning—whether meanings are tightly packed or loosely associated</li>
   398→            <li><b>Color:</b> The emotional or evaluative "tint" of meanings at that stratum (e.g., positive, neutral, negative, sacred, profane)</li>
   399→            <li><b>Inclusions:</b> Distinctive semantic "fossils"—traces of historical usage, borrowed meanings, or preserved archaisms<sup><a href="#cite7">[7]</a></sup></li>
   400→        </ul>
   401→
   402→        <p>Standard notation designates horizons alphabetically from the surface downward (A, B, C, etc.), with subscripts indicating sub-horizons and special properties. The <b>A horizon</b> (surface) contains current, active meanings; the <b>B horizon</b> contains meanings that have undergone significant transformation; the <b>C horizon</b> contains weathered but recognizable parent meanings; and the <b>R horizon</b> (bedrock) contains the etymological foundations.<sup><a href="#cite8">[8]</a></sup></p>
   403→
   404→        <h3 id="Semantic_unconformities">Semantic unconformities</h3>
   405→        <p>A <b>semantic unconformity</b> occurs when the normal sequence of meaning accumulation is disrupted, typically through one of three processes:<sup><a href="#cite9">[9]</a></sup></p>
   406→
   407→        <ul>
   408→            <li><b>Angular unconformity:</b> When meanings are deposited at different "angles" of usage, indicating a fundamental shift in how a term is employed. The older meanings were tilted or reoriented before new deposition began.</li>
   409→            <li><b>Disconformity:</b> When a period of erosion removes some meanings before new deposition resumes, creating a gap in the record. Evidence of this includes missing expected intermediate meanings.</li>
   410→            <li><b>Nonconformity:</b> When new meanings are deposited directly onto the etymological "bedrock" after all accumulated meanings have been stripped away, as occurs with radical <a href="semantic-drift.html">semantic drift</a> or deliberate linguistic reclamation.<sup><a href="#cite10">[10]</a></sup></li>
   411→        </ul>
   412→
   413→        <p>Unconformities are particularly valuable to researchers because they record periods of semantic upheaval, linguistic revolution, or cultural trauma that disrupted normal patterns of meaning accumulation.</p>
   414→
   415→        <blockquote>
   416→            "Every unconformity tells a story of what was lost. The gap itself is evidence—a scar in the semantic column where meanings were stripped away by forces we can only infer from what remains above and below."<br>
   417→            — Dr. Fiona MacLeod, 2025
   418→        </blockquote>
   419→
   420→        <h2 id="Methodology">Methodology<span class="mw-editsection">[<a href="/wiki/Semantic_stratigraphy?action=edit&section=2">edit</a>]</span></h2>
   421→
   422→        <h3 id="Core_sampling">Core sampling</h3>
   423→        <p>The primary data-gathering technique in semantic stratigraphy is <b>core sampling</b>—extracting a complete vertical section through the meaning layers of a term, concept, or <a href="mnemonic-commons.html">mnemonic commons</a> region. This produces a <b>semantic core</b> that can be analyzed layer by layer.<sup><a href="#cite11">[11]</a></sup></p>
   424→
   425→        <p>Core sampling methods include:</p>
   426→        <ul>
   427→            <li><b>Historical corpus analysis:</b> Examining dated texts to recover the sequence of meaning changes over documented time</li>
   428→            <li><b>Association excavation:</b> Using structured association tasks to probe different depths of meaning in individual minds</li>
   429→            <li><b>Cross-generational sampling:</b> Comparing meaning profiles across age cohorts to infer temporal sequence</li>
   430→            <li><b>Echo signature analysis:</b> Using <a href="echo-cartography.html">echo cartographic</a> techniques to detect residual traces of eroded meanings<sup><a href="#cite12">[12]</a></sup></li>
   431→        </ul>
   432→
   433→        <h3 id="Layer_identification">Layer identification</h3>
   434→        <p>Once a semantic core has been extracted, researchers employ several techniques to identify and characterize individual layers:<sup><a href="#cite13">[13]</a></sup></p>
   435→
   436→        <ul>
   437→            <li><b>Boundary detection:</b> Identifying sharp transitions in meaning properties that indicate horizon boundaries</li>
   438→            <li><b>Index fossils:</b> Locating distinctive semantic elements that appear only in specific time periods, allowing correlation across cores</li>
   439→            <li><b>Compaction assessment:</b> Measuring the degree to which meanings have been compressed, which correlates with age and burial depth</li>
   440→            <li><b>Diagenetic analysis:</b> Examining how meanings have been chemically altered through long-term processes of association and inference</li>
   441→        </ul>
   442→
   443→        <h3 id="Correlation_techniques">Correlation techniques</h3>
   444→        <p>A major challenge in semantic stratigraphy is correlating layers across different semantic columns—establishing that horizon B in one word's column represents the same depositional period as horizon B in another's. The Edinburgh Institute has developed several correlation methods:<sup><a href="#cite14">[14]</a></sup></p>
   445→
   446→        <ul>
   447→            <li><b>Biostratigraphic correlation:</b> Using shared cultural references as "index fossils" to match layers across columns</li>
   448→            <li><b>Event stratigraphy:</b> Identifying distinctive layers deposited by specific historical events (wars, technologies, social movements) that affected multiple terms simultaneously</li>
   449→            <li><b>Chronometric dating:</b> Using <a href="lexical-half-life.html">lexical half-life</a> measurements to estimate absolute ages of layers</li>
   450→            <li><b>Sequence stratigraphy:</b> Matching patterns of deposition and erosion across semantic columns<sup><a href="#cite15">[15]</a></sup></li>
   451→        </ul>
   452→
   453→        <h2 id="Depositional_contexts">Depositional contexts<span class="mw-editsection">[<a href="/wiki/Semantic_stratigraphy?action=edit&section=3">edit</a>]</span></h2>
   454→        <p>MacLeod and Osman identified several distinct <b>depositional environments</b> in which meanings accumulate with different characteristics:<sup><a href="#cite16">[16]</a></sup></p>
   455→
   456→        <table class="wikitable">
   457→            <tr>
   458→                <th>Environment</th>
   459→                <th>Deposition rate</th>
   460→                <th>Layer characteristics</th>
   461→                <th>Preservation quality</th>
   462→            </tr>
   463→            <tr>
   464→                <td><b>Technical discourse</b></td>
   465→                <td>Slow, controlled</td>
   466→                <td>Well-defined, distinct boundaries</td>
   467→                <td>Excellent (definitions preserved)</td>
   468→            </tr>
   469→            <tr>
   470→                <td><b>Vernacular speech</b></td>
   471→                <td>Rapid, variable</td>
   472→                <td>Diffuse, gradational boundaries</td>
   473→                <td>Poor (rapid reworking)</td>
   474→            </tr>
   475→            <tr>
   476→                <td><b>Literary usage</b></td>
   477→                <td>Moderate, episodic</td>
   478→                <td>Rich in inclusions and fossils</td>
   479→                <td>Good (textual preservation)</td>
   480→            </tr>
   481→            <tr>
   482→                <td><b>Digital media</b></td>
   483→                <td>Very rapid, chaotic</td>
   484→                <td>Thin, numerous, unstable</td>
   485→                <td>Variable (archiving dependent)</td>
   486→            </tr>
   487→            <tr>
   488→                <td><b>Institutional language</b></td>
   489→                <td>Very slow</td>
   490→                <td>Thick, resistant to erosion</td>
   491→                <td>Excellent (bureaucratic inertia)</td>
   492→            </tr>
   493→        </table>
   494→
   495→        <p>Understanding the depositional context of a layer aids in interpreting its properties and predicting its future behavior. Layers deposited in high-energy environments (e.g., social media) are more likely to be reworked or eroded, while those deposited in low-energy environments (e.g., legal terminology) may persist for centuries.<sup><a href="#cite17">[17]</a></sup></p>
   496→
   497→        <h2 id="Integration">Integration with related fields<span class="mw-editsection">[<a href="/wiki/Semantic_stratigraphy?action=edit&section=4">edit</a>]</span></h2>
   498→        <p>Semantic stratigraphy is designed to complement and integrate with existing approaches in <a href="chronolinguistics.html">chronolinguistics</a> and related fields:<sup><a href="#cite18">[18]</a></sup></p>
   499→
   500→        <ul>
   501→            <li><b><a href="echo-cartography.html">Echo cartography</a>:</b> Provides horizontal (spatial) distribution data that, combined with stratigraphic vertical data, enables three-dimensional reconstruction of meaning structures</li>
   502→            <li><b><a href="psychostrata.html">Psychostrata</a> theory:</b> Offers a framework for understanding how individual mental strata interact with collectively deposited semantic strata</li>
   503→            <li><b><a href="semantic-drift.html">Semantic drift</a> studies:</b> Drift rates and patterns inform predictions about future erosion and deposition</li>
   504→            <li><b><a href="lexical-half-life.html">Lexical half-life</a> research:</b> Provides chronometric tools for dating semantic layers</li>
   505→            <li><b><a href="ghost-vocabulary.html">Ghost vocabulary</a> studies:</b> Documents eroded semantic material, helping to identify unconformities and reconstruct missing layers<sup><a href="#cite19">[19]</a></sup></li>
   506→        </ul>
   507→
   508→        <p>The integration of stratigraphic methods with echo cartographic mapping has been particularly productive, allowing researchers to construct <b>semantic block diagrams</b>—three-dimensional representations showing both the horizontal extent and vertical structure of meaning formations across the <a href="mnemonic-commons.html">mnemonic commons</a>.<sup><a href="#cite20">[20]</a></sup></p>
   509→
   510→        <h2 id="Applications">Applications<span class="mw-editsection">[<a href="/wiki/Semantic_stratigraphy?action=edit&section=5">edit</a>]</span></h2>
   511→        <p>Early applications of semantic stratigraphy have focused on several areas:<sup><a href="#cite21">[21]</a></sup></p>
   512→
   513→        <ul>
   514→            <li><b>Historical semantics:</b> Reconstructing the complete depositional history of culturally significant terms</li>
   515→            <li><b>Etymology revision:</b> Using stratigraphic evidence to reassess traditional etymological narratives</li>
   516→            <li><b><a href="semantic-hygiene.html">Semantic hygiene</a> planning:</b> Identifying vulnerable layers that may be subject to future erosion and developing preservation strategies</li>
   517→            <li><b>Cultural trauma assessment:</b> Detecting unconformities that record collective experiences of disruption</li>
   518→            <li><b>Artificial language design:</b> Engineering semantic columns with desired properties for constructed languages or technical vocabularies</li>
   519→        </ul>
   520→
   521→        <p>Researchers at the Edinburgh Institute are currently developing applications in <b>predictive stratigraphy</b>—using knowledge of depositional patterns to forecast how current meaning formations will evolve. This work connects to emerging research on <a href="NEXT_PAGE_PLACEHOLDER">temporal linguistics engineering</a>, which seeks to intentionally shape the future evolution of language.<sup><a href="#cite22">[22]</a></sup></p>
   522→
   523→        <h2 id="Limitations">Limitations and challenges<span class="mw-editsection">[<a href="/wiki/Semantic_stratigraphy?action=edit&section=6">edit</a>]</span></h2>
   524→        <p>The methodology faces several significant challenges:<sup><a href="#cite23">[23]</a></sup></p>
   525→
   526→        <ul>
   527→            <li><b>Bioturbation:</b> Ongoing associative processes continually mix and disturb semantic layers, obscuring original stratification</li>
   528→            <li><b>Observer effects:</b> The act of sampling meanings may alter the deposits being studied</li>
   529→            <li><b>Incompleteness:</b> The semantic record is inherently incomplete; many meanings leave no trace, and erosion removes others</li>
   530→            <li><b>Non-uniformitarianism:</b> Unlike geological processes, semantic deposition may not follow consistent rules across time and cultures</li>
   531→            <li><b>Metaphor strain:</b> Critics argue the geological metaphor may be pushed beyond its useful limits, generating false precision about fundamentally different phenomena<sup><a href="#cite24">[24]</a></sup></li>
   532→        </ul>
   533→
   534→        <p>MacLeod has acknowledged these limitations while defending the methodology's utility: "We do not claim that meaning is literally sedimentary. We claim that treating it as if it were sedimentary reveals patterns that other approaches miss. The proof is in the discoveries."<sup><a href="#cite25">[25]</a></sup></p>
   535→
