   302→                <td>Temporal linguistics, Time-language studies</td>
   303→            </tr>
   304→            <tr>
   305→                <th scope="row">Field</th>
   306→                <td><a href="/wiki/Linguistics">Linguistics</a>, <a href="temporal-debt.html">Temporal debt studies</a>, <a href="/wiki/Cognitive_science">Cognitive science</a></td>
   307→            </tr>
